import React, { Component } from 'react';
import { Button } from '@material-ui/core';

export default class ViewWordsDialog extends Component {
    constructor(props) {
        super(props);
        this.state = {
            open: false,
        };
    }

    handleOpen = () => {
        this.setState({
            open: true
        });
    }

    render() {
        return <div>
            <Button onClick = {handleOpen}> View Words </Button>

        </div>
    }
}
